// SPDX-License-Identifier: MIT
import './LurryToken.sol';

pragma solidity ^0.8.0;

contract LurryTokenSale {
  // keep track of admin w/ a state variable
  // admin doesnt have public visibility -> dont expose address of admin 
  address admin; 
  LurryToken public tokenContract;
  uint256 public tokenPrice;
  uint256 public tokensSold;

  // sell event 
  event Sell (address _buyer, uint256 _amount);


  constructor(LurryToken _tokenContract, uint256 _tokenPrice) {
    // assign an admin 
    // msg is a global variable in solidity that has a sender - add of person who called the f(x) 
    admin = msg.sender;
    // token contract 
    tokenContract = _tokenContract;
    // need to add token contract b/c we want to purchase tokens
    // add reference to contract inside tokenSale contract w/ constructor
    // token price 
    tokenPrice = _tokenPrice;

  }

  // multiply - takes two nums you want to multiply by and returns value
  // internal - only inside the contract, cant be called externally
  // pure - not reading or writing transactions, just a pure f(x)
  function multiply(uint x, uint y) internal pure returns (uint z) {
    require (y == 0 || (z = x * y) / y == x);
  }


  // buy tokens 
  // vis - public b/c want people to buy the tokens - call buyTokens f(x)
  // payable - want someone to be able to send Eth via tx w/ this f(x)
  // any f(x) in solidity that wants to send Eth = payable 

  // account can call this f(x) - pass in # of tokens they want, send the value w/ their wallet (client side)
  function buyTokens(uint256 _numberOfTokens) public payable {

      // require that value of token is equal to the token price 
      // msg.value - metadata we get when this f(x) is called - amt of wei this f(x) is sending
      require(msg.value == multiply(_numberOfTokens, tokenPrice));

      // require that there are enough tokens in the contract 
      // this refers to the address of the contract itself (tokenSaleContract)
      require(tokenContract.balanceOf(address(this)) >= _numberOfTokens);

      // require that a transfer is successful 
      // if doesn't happen - transaction will revert*
      // buy functionality 
      require(tokenContract.transfer(msg.sender, _numberOfTokens));


      // keeps track of number of tokensSold 
      tokensSold += _numberOfTokens;

      // trigger sell event 
      // since f(x) is payable, buyer is act calling the f(x)
      emit Sell(msg.sender, _numberOfTokens);
  }


  // Ending the token sale - only admin can do this
  function endSale() public {
    // require that only admin can end token sale
  //   require(msg.sender == admin);

  //   // transfer remaining LurryTokens to admin
  //   require(tokenContract.transfer(admin, tokenContract.balanceOf(address(this))));

  //   // destroy this contract 
  // selfdestruct(payable(admin));

  require(msg.sender == admin);
  require(tokenContract.transfer(admin, tokenContract.balanceOf(address(this))));

  // transfer balance to admin -> don't destroy contract
  // **tokens aren't being transferred to admin***
  payable(admin).transfer(address(this).balance);
  // selfdestruct(admin);


  }

}
